    <NavigationContainer>
    <Stack.Navigator initialroute={restaurante}>
    <Stack.Screen name="Restaurantes" component={restaurantes} initialParams={{ restaurante: restaurante}}/>
    <Stack.Screen name="Pratos" component={restauranteMenu}/>
    </Stack.Navigator>
    </NavigationContainer>

);
}




